import React from "react";
import { useState } from "react";

function Home() {
  const [houses, setHouses] = useState([]);
  async function getHouses() {
    try {
      let res = await fetch("http://localhost:9292/houses");
      return await res.json();
    } catch (error) {
      console.log(error);
    }
  }
  const showHouses = () => {
    let h
  }

  return (
    <>
      <div className="home">
        <div className="card bg-dark text-white border-0">
          <img
            src="https://i.pinimg.com/736x/4a/a8/f5/4aa8f5d237daabb1ceec9aa3a3931bad.jpg"
            className="card-img"
            alt="Background"
            height="700px"
            width="90%"
          />
          <div className="card-img-overlay d-flex flex-column justify-content-center">
            <div className="container">
              <h5 className="card-title  display-3 fw-bolder mb-0">
                {" "}
                <header className="masthead">
                  <div className="container px-4 px-lg-5 h-100">
                    <div className="row gx-4 gx-lg-5 h-100 align-items-center justify-content-center text-center">
                      <div className="col-lg-10 align-self-end">
                        <h1 className="font-weight-bold">
                          <span>🏠</span>WELCOME TO OUR HOMES<span>🏠</span>
                        </h1>
                        <hr className="divider" />
                      </div>
                      <div className="col-lg-8 align-self-baseline">
                        <p className="text-white-75 mb-5">
                          "When one door closes,buy another one and open it
                          yourself 🔑 "
                        </p>
                        <div className="dropdown">
                          <button
                            onClick={showHouses}
                            className="btn btn-primary"
                            type="button"
                          >
                            Gallery
                          </button>
                        </div>
                      </div>
                    </div>
                  </div>
                </header>
              </h5>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
export default Home;
